  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset (MISC_0_3M_CLR_2009)includes
  truecolor ortho imagery covering the Barre-Monteplier (Capital Region) of Vermont.
  VCGI reprojected the imagery from its original coordinates system (UTM Z18) to VT
  State Plane Meters (NAD83). For this dataset, the natural color orthoimages were
  produced at 0.3-meter pixel resolution (approximately 1-foot). There is no image
  overlap between adjacent files. The naming convention is based on the U.S. National
  Grid (USNG), taking the coordinates of the SW corner of the orthoimage.\",\n\t\"license_title\":
